import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const navbar = (
  <nav>
     <h1>Bistro 3way</h1>
     <ul>
      <li>Valor</li>
      <li>Quem Somos</li>
      <li>Contato</li>          
     </ul>
  </nav>
);

function Page() {
  return (
  <div>
  <img src="./images/logo-react.png" alt="logo react" width="40px" />
  <h1>Curiosidades sobre o React</h1>
  <ul>
  <li>Foi lançado pela primeira vez em 2013</li>
  <li>Foi originalmente criado por Jordan Walke</li>
  <li>Tem mais de 100 mil estrelas no GitHub</li>
  <li>É mantido pelo Facebook</li>
  <li>Capacita milhares de aplicativos corporativos,
  incluindo aplicativos móveis</li>
  </ul>
  </div>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  //<React.StrictMode>
    //{navbar}
  //</React.StrictMode>
    <React.StrictMode>
    < Page />
  </React.StrictMode>
);
